import './App.css';

const App = () => (

  <Container>
  <Navbar>
    <Navbar.Brand href="#home">Eth-ter-I-Die</Navbar.Brand>
    <Navbar.Toggle />

  </Navbar>
    <Row>
      <Col>1 of 1</Col>
